('UCZUyPT9DkJWmS_DzdOi7RIA','Caleb Curry','Programming Made Fun and Simple  \n\nHigh quality tutorials that are fun, educational, and easy to follow.  Teaching programming is my passion!  I find joy in making complex material easy to understand.  Although specializing in databases, I still create tutorials for a variety of programming languages and subjects.\n\nI ve decided that it is only right to upload videos of great quality and value.  Here you will find videos on database design, MySQL, PHP, and more!  As a side note, many videos contain horribly cheesy jokes and random stories...you ve been warned.','2009-08-18 18:32:42',13951067,159000,1398);
