our favorite celebrity go to: https://www.alux.com/networth/\n--\nFor businesses inquiries we re available at:\nhttps://www.alux.com/contact/','2018-09-30 15:36:57',634139,20680,545,612,'UCNjPtOCvMrKY5eLwr_-7eUg'),('aGWz6RYziPE','Nice, l envers du décor - Reportage','Nice. 300 000 habitants l hiver, près de 3 millions l été. Français, Anglais ou Italiens, les touristes viennent profiter de la Baie des Anges, des plages privées, des palaces et de ses casinos. Une manne économique vitale pour la ville mais aussi une cible alléchante pour les délinquants. Cambriolages, vols à la portière, vols avec violences, en ville ou sur la plage, l insécurité représente une menace pour le tourisme local. Véritable fléau en période estivale, le vol à la portière. Une spécialité niçoise. En scooter ou à pied, les voleurs agressent les automobilistes aux feux rouges, arrachent les sacs avec violence et disparaissent dans la circulation. En été, à Nice, on compte chaque jour une dizaine de vols à la portière. La plupart des délinquants, souvent mineurs, viennent de l Ariane, une cité de 15 000 habitants à la périphérie de la ville. Autre fléau en période estivale : les pickpockets qui sévissent sur la plage. Nouveaux arrivants, certains de ces voleurs viennent de Roumanie. Ils vivent dans des bidonvilles insalubres, installés à quelques pas de la Promenade des Anglais. En suivant sur le terrain le travail des policiers de la Brigade anti-criminalité, nos équipes ont filmé l envers du décor, la Baie des Anges comme on ne la voit pas sur les dépliants publicitaires. Auteur : Céline Destève - Jean-Michel Canovas.','2018-05-24 15:30:01',1317941,3586,685,1134,'UC50uCdUubc04xXZz7bqv5ng'),('Akwm2UZJ34o','Hot Food | POEM | Kids  Poems and Stories With Michael Rosen','Hot Food | POEM | Kids  Poems and Stories With Michael Rosen\nFrom The Hypnotiser\nPublished by Lions Poetry\n\nHere is the Hypnotiser Playlist for more Michael Rosen Videos\nhttps://www.youtube.com/playlist?list=PLkt1aZj6mw2VAaqd6TtJdjRmUqhNRBT0j\n\nYou can browse and buy Michael Rosen Books here:\nhttps://www.michaelrosen.co.uk/books/\n\nPlease contribute on Patreon to help us make more vids and get great rewards for you.\nhttps://www.patreon.com/KPSWithMichaelRosen\n\nI wrote a book of poems for children called The Hypnotiser some years ago and then it went out of print. I couldn’t get anyone to reprint it, so I asked my son Joe to film me performing the book for this website. All you need to do is click on whichever poem you want in the gallery below.\nThere are second-hand copies of The Hypnotiser available on various sites on the web, most obviously at Amazon, Abe Books and eBay.\n\n \nREVIEW\n Right class 6, RIGHT CLASS 6, I m talking, I m talking, I want complete quiet and that includes you, David Alexander, yes you...   The Outing , by Michael Rosen, just one of the fantastic and hilarious poems from his short story and poetry collection The Hypnotiser. This particular poem was read to me as a young child in primary school time and time again. Each time the names in the poem were changed to the names of the pupils in my class. It never got old, or less hilarious and I wouldn t hesitate in reading this to my future classes during my teaching career.\n\nOther great poems from this collection include  The Car Trip ; a highlight of the sibling chaos that goes on in the back of the car when Mum is driving:  He started it. I didn t. He started it... ,  Tomato 1 ; the gruelling ordeal of being given a tomato to eat by your mother and you simply just hate tomatoes, and  Tidy Your Room ; every child s nightmare. Each and every poem and short story relates to children through typical experiences that most would have endured. This book enlightens children s love and enthusiasm for poetry, an almost forgotten about genre for most children; a runner up to fiction books.\n\nThis book can have many uses in the classroom; appropriate for children in Key Stage Two it can be read by the teacher at the end of the day during story time, like in my own experience at primary school. Or, during a poetry topic in Literacy, this book could model fun, interesting, age appropriate poetry that will inspire children to write their own poems. Likewise for shared reading; this book would be fantastic to put under the visualiser and look through with the class at the how poems are written, their structure, do they rhyme? do they tell a story? All sorts of things can be addressed with the class as a whole.\n\nThis book needs to be exposed to children, whether at school on the class bookshelf, or online where you can find video clips of Michael Rosen performing these poems; a great filler for those odd five minutes that arise during the busy school day. A Must read, not just for children but teachers as well!\n\nWho is Michael Rosen?\nMy first book for children was called Mind Your Own Business and it came out in 1974. Quentin Blake did wonderful line drawings for it.\n\nEver since then, I’ve been doing these things:\n\nWriting books\n\nWriting articles for newspapers and magazines\n\nGoing to schools, libraries and theatres and performing the poems in my books\n\nHelping children write poems and stories\n\nMaking radio programmes, mostly about words, language or books\n\nAppearing on TV, either reading books, or talking about books\n\nTeaching at universities about children’s literature\n\nRunning workshops for teachers about poetry\n\nIn any week, I might be doing all of these things! To tell the truth, I don’t really know what I’m doing tomorrow, unless I look in my diary to see.\n\n#Michael Rosen\n#Kids\n#Poetry','2008-02-20 21:12:49',19222885,474336,8682,3631,'UC7D-mXO4kk-XWvH6lBXdrPw'),('aNcZTiROURk','Fruit Salad 4 Ways','Check out the Tasty One-Stop Shop for cookbooks, aprons, hats, and more at TastyShop.com: http://bit.ly/2mEBY0e\n\nHere is what you ll need!\n\nFruit Salad 4 Ways\nServes 4-5 (per recipe)\n\nTropical Salad\n\nINGREDIENTS\n2 oranges, peeled and halved\n12 ounces strawberries, quartered\n2 mangoes, chopped\n4 kiwis, peeled and chopped or sliced\n\nDressing \n3 tablespoons lime juice\n1 tablespoon maple syrup\n\nPREPARATION\n\nCombine all the ingredients above in a large bowl.\nMix the dressing ingredients together and spread over fruit, mix well.\n\n\nBanana Berry\n3 bananas, sliced\n12 ounces strawberries, quartered\n12 ounces raspberries\n\n\nPREPARATION\n\nCombine all the ingredients above in a large bowl.\nMix the dressing ingredients together and spread over fruit, mix well.\n\n\nMango Melon\n\nINGREDIENTS\n\n2 cups pineapple, cubed\n2 cups cantaloupe, cubed\n2 cups honeydew, cubed\n2 cups mangoes, cubed\n\n\nPREPARATION\n\nCombine all the ingredients above in a large bowl.\nMix the dressing ingredients together and spread over fruit, mix well.\n\n\nMelon Berry\n\nINGREDIENTS\n\n12 ounces strawberries, quartered\n12 ounces raspberries\n12 ounces blueberries\n8 ounces blackberries\n3 cups watermelon, cubed\n\n\nPREPARATION\n\nCombine all the ingredients above in a large bowl.\nMix the dressing ingredients together and spread over fruit, mix well.\n\n\n\n\n\n\nCheck us out on Facebook! - facebook.com/buzzfeedtasty\n\nMUSIC\nLicensed via Audio Network\n\nCreated by https://www.buzzfeed.com/bfmp/videos/15797','2017-04-22 19:00:46',1332270,21038,514,542,'UCJFp8uSYCjXOMnkUyb3CQ3Q'),('B9vPoCOP7oY','What is an API? - Application Programming Interface','Want to build profitable Apps ($107K+) without code in days?\n▶︎ https://zerotoapp.com/ytd\n\n\n\n\n#1 Tool To Build and Grow a 6 Figure On-Line Business: \nhttps://mardox.media/clickfunnels\n\nLearn How To Make Money Being an Expert:\nhttp://mardox.media/expert-secrets\n\nSecrets Of Building ad Growing an Online Business:\nhttp://mardox.media/dot-com-secrets\n\nTools I Use To Make These Videos:\n\niPad 2018: https://amzn.to/2ubz0Dx\n\nApple Pencil: https://amzn.to/2JcC6Ms\n\nLuma Fusion App: http://mardox.media/luma-fusion\n\nAdobe Draw App: http://mardox.media/adobe-d