 Design, MySQL Command line, MySQL Functions etc. End of the training you will be able to create and administer your own MySQL Database and manage data.   \n\n- - - - - - - - - - - - - -\n\nWho should go for this course?\n\nThis course can be beneficial for people having the below professional background:  \nDatabase Developers \nApplication Developers\nDatabase Designers\nDatabase Administrators\n- - - - - - - - - - - - - -\n\nProject\n\nIn the project you will be creating a Database using MySQL on SALARY MANAGEMENT SYSTEM:-\n\n•   Employee list to be maintained having id, name, designation, experience\n•   Salary details having employee id, current salary\n•   Salary in hand details having employee id, CTC salary, pf deduction or any other deduction and net salary to be given and also maintain details of total savings of employee\n•   Salary increment to be given by next year if any depending upon constraints\n•   Deduction in monthly salary if any depending upon any discrepancy in work and amount to be deducted.\n\n- - - - - - - - - - - - - -  \n\nGot a question on the topic? Please share it in the comment section below and our experts will answer it for you. \n\nPlease write back to us at sales@edureka.co or call us at IND: 9606058406 / US: 18338555775 (toll-free) for more information.','2019-01-21 05:28:43',58993,790,28,29,'UCkw4JCwteGrDHIsyIIKo4tQ'),('hb7Q33ysCwI','Coding is Not Difficult - Bill Gates','Hello Friends welcome to Soft Tech. In this video about big techies like Bill Gates,David Karp,Mark Zuckerberg Karlie Kloss,Explain the importance of coding.\n\n\nIf you like this video plese subscribe my channel \nEmail-softtech445@gmail.com','2018-01-12 15:35:21',1038189,24236,696,1848,'UC-ZMWGgdNaiRcKXyRHdl_bg'),('I60A8-iORm8','NICE CITY TOUR / FRANCE','City tour of Nice, France - the capital on the French Riviera and the second largest French city on the Mediterranean coast after Marseille. The beautiful city has a lot to offer. Its natural picturesque beauty in combination with lively city ambience and mild mediterranean climate attract tourists and visitors all year round. Nice can also serve as a base and starting point to your journey along the spectacular French Riviera popular with its glamour, luxurious lifestyle and breathtaking scenery. \nThis video presents some of the main attractions and places to see, including Castle Hill, Place Massena, Promenade des Anglais, the beach, the Old town filled with many restaurants and shops, the Opera house, Place Garibaldi, Avenue Jean Medecin, the Port of Nice and more.\n\nMy NICE s Blog: https://bit.ly/2RUVCp2\n\n\n✔  More places on the FRENCH RIVIERA: https://goo.gl/8ZfGhk\n-------------------------------------------------------------------------------------------------------\nMONTE CARLO, MONACO: https://youtu.be/ci0sb7JrB4k\nSAINT-TROPEZ: https://youtu.be/huU6gv7fa1g\nCANNES: https://youtu.be/kez0SfQgdjo\nVILLA ROTHSCHILD: https://youtu.be/6LTV2DNJkJ4\nNICE CASTLE HILL: https://youtu.be/KmCU_ndJT8M\nEZE VILLAGE: https://youtu.be/p3yFAt9KETM\n\n✔  MORE TRAVEL VIDEOS:\n-----------------------------------------------------------------------------------------------------\nPUERTO BANUS, SPAIN: https://youtu.be/0nsRppUwbJQ\nMARBELLA, SPAIN: https://youtu.be/DDEF0MnYRMc\nAMSTERDAM CITY TOUR: https://youtu.be/7Qv6HuBadCI\nBARI, ITALY: https://youtu.be/V0Huc-Jqxk0\nCOLOGNE, GERMANY: https://youtu.be/_b3oMcPGVt0\nALBEROBELLO, ITALY: https://youtu.be/qFgfAdciGE8\nCRUISE GREEK ISLANDS: https://youtu.be/HulIef4DMQ4\nTAORMINA, ITALY: https://youtu.be/X-yoKrLoCQE\nMALTA TOP PLACES: https://youtu.be/wZ1CF_wu8jo\nBRUSSELS, BELGIUM: https://youtu.be/gfUSAEJINRY\nHALONG BAY, VIETNAM: https://youtu.be/nFMSE_l7yF0\nATHENS, GREECE: https://youtu.be/UupuHT9BUnc\nSIEM REAP, CAMBODIA: https://youtu.be/UHKwRyS7k5k\nBANGKOK, THAILAND: https://youtu.be/GO3OboR0G1E\nHYDRA ISLAND, GREECE: https://youtu.be/kgRsth08SFk\nBELEK, ANTALYA,TURKEY: https://youtu.be/cHRfSX9hyec\n--------------------------