the fans will be able to see the special colors of SEVENTEEN. \n \n\n▶1theK FB  : http://www.facebook.com/1theK\n▶1theK TW : https://twitter.com/1theK\n▶1theK G+ : https://plus.google.com/+1theK\n\n去る4月、1stフルアルバム『LOVE＆LETTER』のタイトル曲「きれい」で、‘自主制作アイドル‘という名声にふさわしく、さらに成長した姿を見せて多くの愛を受けたSEVENTEENが、7月4日の深夜リパッケージアルバムをリリースする。\n今回のアルバムは、過去「きれい」の活動の際、熱い愛を送ってくれたファンに感謝の気持ちを伝えるために企画したもの。既存の『LOVE＆LETTER』の収録曲に新曲5曲を加え全15曲で構成されており、さらに豊かなSEVENTEENの音楽色を感じることができる。\n\n\n\n지난 4월 첫 번째 정규앨범  LOVE&LETTER 의 타이틀곡  예쁘다 로  자체제작 아이돌 이라는 명성에 걸맞게 한층 더 성장한 모습을 보여주며 많은 사랑을 받은 세븐틴이 오는 7월 4일 자정 리패키지 앨범을 발표한다.\n\n이번 앨범은 지난  예쁘다  활동에 뜨거운 사랑을 보내준 팬들에게 감사의 마음을 전하고자 기획된 것. 기존  LOVE&LETTER 의 수록곡과 신곡 5곡을 더한 총 15곡으로 구성되어 있으며, 한층 풍성한 세븐틴만의 음악 색깔을 느낄 수 있다.','2016-07-03 16:23:30',69150651,830990,11326,35760,'UCweOkPb1wVVH0Q0Tlj4a5Pw'),('ONlxJihDQxI','OGC Nice - FC Metz ( 4-1 ) - Résumé - (OGCN - FCM) / 2019-20','Revivez les meilleurs moments de OGC Nice - FC Metz (4-1) en vidéo. \n\nLigue 1 Conforama - Saison 2019/2020 - 17ème journée Allianz Riviera - samedi 7 décembre 2019\n\nButeurs : Wylan CYPRIEN (9  - OGC Nice) / Wylan CYPRIEN (41  pen - OGC Nice) / Ignatius GANAGO (59  - OGC Nice) / Ibrahima NIANE (73  - FC Metz) / Pierre LEES-MELOU (75  - OGC Nice) \n\nComposition OGC Nice : 2 - Stanley NSOKI / 4 - DANTE (c) / 8 - Pierre LEES-MELOU / 9 - Kasper DOLBERG / 10 - Adam OUNAS / 15 - Patrick BURNER / 18 - Alexis CLAUDE-MAURICE / 20 - Youcef ATAL / 23 - Malang SARR / 25 - Wylan CYPRIEN / 40 - Walter BENITEZ \n\nComposition FC Metz : 1 - Paul DELECROIX / 3 - Matthieu UDOL / 6 - Mamadou FOFANA / 9 - Thierry AMBROSE / 13 - Stoppila SUNZU / 17 - Thomas DELAINE / 18 - Fabien CENTONZE / 19 - Habib MAIGA / 20 - Habib DIALLO (c) / 21 - John BOYE / 25 - Adama TRAORE \n\nAbonnez-vous à la chaîne : https://www.youtube.com/subscription_center?add_user=ligue1fr \nSuivez nous sur Instagram : https://instagram.com/Ligue1Conforama/ \nSuivez nous sur Twitter : https://www.twitter.com/Ligue1Conforama \nSuivez nous sur Facebook : htt