ed by Audio Library https://youtu.be/SQWFdnbzlgI\n\nHi, I m John Fish, and I m a Harvard Computer Science student. In this video, I talk about all of the various projects which I have completed in my ten year journey of coding. I started out learning basic HTML and CSS and making HTML tutorials and CSS tutorials. I then began learning Javascript and creating webpages with Javascript. Then, I began to learn Python and started contest programming. I then continued with Python, web programming, and picked up some other languages along the way. In this video I talk about my national-medal science fair project, Harvard Computer Science curriculum, Harvard Computer Science classes, Harvard Computer science projects, and so on. In this video I give examples of artificial intelligence programs which I have written and I explain basic artificial intelligence for games.\n\nLinks to all available projects in this video (some source code is private due to class policies--can t have people cheating????):\n - Python coin flip script: https://github.com/lchski/flip-coin\n - jQuery dice rolling page: https://github.com/johnafish/dx\n - jQuery point plotting page: https://github.com/johnafish/PlotPoints\n - Python static site generator: https://github.com/johnafish/trout\n - Python OCR: https://github.com/johnafish/bigeye\n - Python Othello with minimax AI and alpha-beta pruning: https://github.com/johnafish/othello\n - Muse meditation project: https://devpost.com/software/musetation\n - Muse robotic hand: https://devpost.com/software/muse-grip\n - Social network for trees: https://devpost.com/software/timber\n - Code learning platform: https://devpost.com/software/intercode\n - Clicky Kitty android game in Java: https://play.google.com/store/apps/details?id=com.aslan.clickykitty&hl=en\n - Science fair project measuring the growth rate of trees over time using google streetview images: https://secure.youthscience.ca/virtualcwsf/projectdetails.php?id=4828&\n - Java reaction diffusion simulator: https://github.com/johnafish/reactionDiffusion\n - Java convex hull finder: https://github.com/johnafish/ConvexHull\n - Instagram bot thing: https://github.com/johnafish/socai\n - Eleven android game (Java): https://play.google.com/store/apps/details?id=com.aslan.eleven&hl=en\n - Shopify app I worked on for two years: https://apps.shopify.com/flow\n - Python sentiment analysis on comments: https://github.com/johnafish/senticomment','2019-06-01 14:00:08',620888,21652,714,1390,'UC5Gmg-VtFmnP8qLq8V7Pvtg'),('W6NZfCO5SIk','JavaScript Tutorial for Beginners: Learn JavaScript in 1 Hour [2019]','Watch this JavaScript tutorial for beginners to learn JavaScript basics in one hour. \n????Get my Complete JavaScript Course to master JavaScript (83% OFF - LIMITED TIME ONLY): http://bit.ly/2M1sp4B\n\n\n⭐️Subscribe for more videos: \nhttps://www.youtube.com/channel/UCWv7vMbMWH4-V0ZXdmDpPBA?sub_confirmation=1\n\nJavaScript is one of the most popular programming languages in 2019. A lot of people are learning JavaScript to become front-end and/or back-end developers. \n\nI ve designed this JavaScript tutorial for beginners to learn JavaScript from scratch. We ll start off by answering the frequently asked questions by beginners about JavaScript and shortly after we ll set up our development environment and start coding. \n\nWhether you re a beginner and want to learn to code, or you know any programming language and just want to learn JavaScript for web development, this tutorial helps you learn JavaScript fast. \n\nYou don t need any prior experience with JavaScript or any other programming languages. Just watch this JavaScript tutorial to the end and you ll be writing JavaScript code in no time. \n\nIf you want to become a front-end developer, you have to learn JavaScript. It is the programming language that every front-end developer must know. \n\nYou can also use JavaScript on the back-end using Node. Node is a run-time environment for executing JavaScript code outside of a browser. With Node and Express (a popular JavaScript framework), you can build back-end of web and mobile applications. \n\nIf you re looking for a crash course that helps you get started with JavaScript quickly, this course is for you. \n\n⭐️TABLE OF CONTENT ⭐️\n\n00:00 What is JavaScript\n04:41 Setting Up the Development Environment \n07:52 JavaScript in Browsers\n11:41 Separation of Concerns\n13:47 JavaScript in Node\n16:11 Variables\n21:49 Constants\n23:35 Primitive Types \n26:47 Dynamic Typing \n30:06 Objects\n35:22 Arrays\n39:41 Functions\n44:22 Types of Functions \n\n⭐️Related Tutorials ⭐️\nNode tutorial for beginners: \nhttps://youtu.be/TlB_eWDSMt4\n\nExpress.js tutorial for beginners:\nhttps://youtu.be/pKd0Rpw7O48\n\nReact tutorial for beginners:\nhttps://youtu.be/Ke90Tje7VS0\n\nAngular tutorial for beginners: \nhttps://youtu.be/k5E2AVpwsko\n\n\n⭐️Learn More ⭐️\nWant to learn more from me? Check out my blog and courses: \n\nhttp://programmingwithmosh.com \nhttps://www.facebook.com/programmingwithmosh/\nhttps://twitter.com/moshhamedani','2018-04-24 02:37:33',1589110,25371,611,1382,'UCWv7vMbMWH4-V0ZXdmDpPBA'),('wR0jg0eQsZA','Database Tutorial for Beginners','This database tutorial will help beginners understand the basics of database management systems. We use helpful analogies to explain a high-level overview of spreadsheets, tables, and database management systems. The logic and concepts in this tutorial will make it easier to understand the more technical aspects of database architecture and Entity Relationship Diagrams (ERD).\n\nWhen it comes to organizing data, we often start by compiling everything into a single spreadsheet (or table). But that approach isn t scalable. As more data floods the system, a single table will result in misleading information, duplicate data, and errors.\n\nA better method is to split your data up into smaller tables that have a narrower focus. These tables organize your data in a more efficient way and come together via relationships to form a database. And a database management system is the software that handles the storage, retrieval, and updating of that database.\n\nDatabase Management Systems are closely related to Entity Relationship Diagrams. If you ve spent any time in a database management system, you know that they typically don’t give you the best options for visualizing your database. It’s all in the programming language and it’s hard to see where the connections are. That’s where Entity Relationship Diagrams come in. It’s a visual way of looking at your database structure. Each table translates into an entity. And your columns in each table are listed as attributes in their respective entity. Finally, the programmed connections between your tables are visualized through relationship lines.\n\nLucidchart is a visual productivity platform that can help you visualize your Database Management System. Our ERD import and export tool make it easy to translate your database into a diagram that helps you spot database errors, find potential improvements, and onboard others to your database.\n\n——\n\nPhotos Requiring Attribution:\nCat Leash - by K B - http://bit.ly/2tDSE9a\n\nLearn more and sign up:\nhttp://www.lucidchart.com\n\nFollow us:\nFacebook: https://www.facebook.com/lucidchart\nTwitter: https://twitter.com/lucidchart\nInstagram: https://www.instagram.com/lucidchart\nLinkedIn: https://www.linkedin.com/company/lucidsoftware','2018-04-16 16:50:11',210700,2557,49,86,'UCnd94o169CbOIJyiEUkTL2A'),('WuBcTJnIuzo','How To Install MySQL on Windows 10','In this post we will learn how to How To Install MySQL on Windows 10. The same procedure can be used for installing MySQL  on Windows 8 / Windows 7.\nBut first let s see What is MySQL . MySQL is a very popular, open source database. Officially pronounced “my Ess Que Ell” (not my sequel). Handles very large databases;  very fast performance.\nWhy are we using MySQL? Free (much cheaper than Oracle!)\nEach student can install MySQL 